import React, { useState } from 'react';
import { Eye, EyeOff, User, Mail, Lock, CreditCard, AlertCircle } from 'lucide-react';
import api from '../api';

const Register = () => {
  const [formData, setFormData] = useState({
    name: '',
    surname: '',
    idNumber: '',
    email: '',
    password: '',
  });
  const [error, setError] = useState('');
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);
  const [showPassword, setShowPassword] = useState(false);
  const [currentStep, setCurrentStep] = useState(1);

  // ... (handleChange, validateStep, and handleSubmit functions remain the same)

  const renderStep = () => {
    const inputClassName = "w-full pl-12 pr-4 py-4 rounded-lg border border-green-200 bg-white/70 backdrop-blur-sm focus:ring-2 focus:ring-lime-400 focus:border-transparent transition-all duration-300 hover:shadow-lg";
    
    switch (currentStep) {
      case 1:
        return (
          <div className="space-y-6">
            <div className="relative group">
              <label className="block text-sm font-medium text-gray-700 mb-2">
                First Name
              </label>
              <div className="relative">
                <User className="absolute left-3 top-3 h-5 w-5 text-green-500 transition-all duration-300 group-hover:scale-110" />
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                  className={inputClassName}
                  placeholder="Mikyle"
                />
              </div>
            </div>

            <div className="relative group">
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Last Name
              </label>
              <div className="relative">
                <User className="absolute left-3 top-3 h-5 w-5 text-green-500 transition-all duration-300 group-hover:scale-110" />
                <input
                  type="text"
                  name="surname"
                  value={formData.surname}
                  onChange={handleChange}
                  className={inputClassName}
                  placeholder="Naidoo"
                />
              </div>
            </div>
          </div>
        );
      case 2:
        return (
          <div className="space-y-6">
            <div className="relative group">
              <label className="block text-sm font-medium text-gray-700 mb-2">
                ID Number
              </label>
              <div className="relative">
                <CreditCard className="absolute left-3 top-3 h-5 w-5 text-green-500 transition-all duration-300 group-hover:scale-110" />
                <input
                  type="text"
                  name="idNumber"
                  value={formData.idNumber}
                  onChange={handleChange}
                  className={inputClassName}
                  placeholder="Enter your 13-digit ID number"
                  maxLength="13"
                />
              </div>
            </div>
          </div>
        );
      case 3:
        return (
          <div className="space-y-6">
            <div className="relative group">
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Email Address
              </label>
              <div className="relative">
                <Mail className="absolute left-3 top-3 h-5 w-5 text-green-500 transition-all duration-300 group-hover:scale-110" />
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  className={inputClassName}
                  placeholder="mikyle@vc.com"
                />
              </div>
            </div>

            <div className="relative group">
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Password
              </label>
              <div className="relative">
                <Lock className="absolute left-3 top-3 h-5 w-5 text-green-500 transition-all duration-300 group-hover:scale-110" />
                <input
                  type={showPassword ? 'text' : 'password'}
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                  className={`${inputClassName} pr-12`}
                  placeholder="Choose a strong password"
                />
                <button
                  type="button"
                  onClick={() => setShowPassword(!showPassword)}
                  className="absolute right-3 top-3 text-green-500 hover:text-green-600 transition-all duration-300 hover:scale-110"
                >
                  {showPassword ? <EyeOff className="h-5 w-5" /> : <Eye className="h-5 w-5" />}
                </button>
              </div>
            </div>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-green-900 via-green-700 to-lime-500 flex items-center justify-center p-4 relative overflow-hidden">
      {/* Animated background elements */}
      <div className="absolute inset-0">
        <div className="absolute top-0 left-1/4 w-96 h-96 bg-lime-300/30 rounded-full blur-3xl animate-pulse"></div>
        <div className="absolute bottom-0 right-1/4 w-96 h-96 bg-green-400/20 rounded-full blur-3xl animate-pulse delay-1000"></div>
        <div className="absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2 w-[40rem] h-[40rem] bg-white/10 rounded-full blur-3xl animate-slow-spin"></div>
      </div>

      <div className="relative w-full max-w-lg">
        <div className="absolute inset-0 bg-gradient-to-r from-green-500/20 to-lime-500/20 rounded-3xl blur-xl transform rotate-6"></div>
        <div className="relative bg-white/90 backdrop-blur-xl rounded-3xl shadow-2xl p-10 transform transition-all duration-500 hover:scale-[1.02]">
          <div className="text-center mb-10">
            <div className="w-24 h-24 bg-gradient-to-br from-green-400 to-lime-500 rounded-full mx-auto mb-6 flex items-center justify-center shadow-xl transform transition-transform duration-500 hover:scale-110 hover:rotate-12">
              <User className="h-12 w-12 text-white" />
            </div>
            <h2 className="text-4xl font-extrabold bg-gradient-to-r from-green-600 to-lime-600 bg-clip-text text-transparent">
              Create Account
            </h2>
            <div className="mt-4 flex items-center justify-center gap-2">
              {[1, 2, 3].map((step) => (
                <div
                  key={step}
                  className={`w-3 h-3 rounded-full transition-all duration-300 ${
                    step === currentStep
                      ? 'bg-gradient-to-r from-green-500 to-lime-500 scale-125'
                      : step < currentStep
                      ? 'bg-green-200'
                      : 'bg-gray-200'
                  }`}
                />
              ))}
            </div>
          </div>

          {error && (
            <div className="mb-8 flex items-center gap-2 text-red-600 bg-red-50 p-4 rounded-lg animate-shake">
              <AlertCircle className="h-6 w-6" />
              <p className="text-sm">{error}</p>
            </div>
          )}

          {message && (
            <div className="mb-8 text-green-600 bg-green-50 p-4 rounded-lg animate-fadeIn">
              <p className="text-sm">{message}</p>
            </div>
          )}

          <form onSubmit={handleSubmit} className="space-y-8">
            {renderStep()}

            <div className="flex gap-4 mt-10">
              {currentStep > 1 && (
                <button
                  type="button"
                  onClick={() => setCurrentStep((prev) => prev - 1)}
                  className="flex-1 py-4 border-2 border-green-500 text-green-600 rounded-lg hover:bg-green-50 transition-all duration-300 hover:shadow-lg transform hover:-translate-y-1"
                >
                  Back
                </button>
              )}
              <button
                type="submit"
                disabled={loading || !validateStep(currentStep)}
                className={`flex-1 py-4 bg-gradient-to-r from-green-500 to-lime-500 text-white rounded-lg shadow-lg hover:shadow-xl transition-all duration-300 transform hover:-translate-y-1 ${
                  loading || !validateStep(currentStep) ? 'opacity-50 cursor-not-allowed' : ''
                }`}
              >
                {loading ? 'Please wait...' : currentStep === 3 ? 'Create Account' : 'Next'}
              </button>
            </div>
          </form>

          <div className="mt-10 text-center">
            <p className="text-gray-600">
              Already have an account?{' '}
              <a
                href="/login"
                className="text-green-600 font-medium hover:text-lime-600 transition-colors duration-300 border-b-2 border-transparent hover:border-lime-500"
              >
                Sign in
              </a>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
